      RayTone.accent400: RayWithLuminanceRgb.fromRay(RayRgb.fromIntARGB(0xFF6AA000), 0.6400000000000001),
      RayTone.accent700: RayWithLuminanceRgb.fromRay(RayRgb.fromIntARGB(0xFF527E00), 0.536),
    }, // tones
  ),
;

  /// The source color with precomputed luminance
  final RayWithLuminanceRgb source;

  /// The complete tonal palette
  final Map<RayTone, RayWithLuminanceRgb> tones;

  const CssRgb(this.source, this.tones);

  // Direct tone access getters
  @override
  RayWithLuminanceRgb? get shade0 => tones[RayTone.shade0];
